                        "Desc": "Guiding the fragrances collected within the Case, Emilie converts them into pure Dendro energy, creating a Level 3 Lumidouce Case and destroying existing Cases.<br>While it exists, the Level 3 Lumidouce Case will not gather nearby Scents, but it will continuously cause Scented Dew to descend, attacking opponents within range and dealing <color style='color:#99FF88;'>Dendro DMG</color>. During this time, 1 drop of Scented Dew will descend every 0.3 seconds, and 1 opponent can become the target every 0.7 seconds.<br>When the duration ends, a Level 1 Lumidouce Case will be recreated. If a Lumidouce Case that had already collected Scents was destroyed when Aromatic Explication was used, the newly created Lumidouce Case will inherit the previous Scents and Level of the destroyed Case.<br>While <color style='color:#FFD780;'>Aromatic Explication</color> is active, the Elemental Skill \"Fragrance Extraction\" will not create a Lumidouce Case.<br><br><i>No matter the perfume, it will begin to change the instant it comes into contact with the air, before finally dissipating amidst the whispers of wind, trees, and grass. In that sense, no two people will appreciate the exact same fragrance.<br>So it is for the paths taken by all who live. In that sense, you can consider perfumes an explication of human life.</i>",
